export default (function(a,b,c,d,e,f,g,h,i){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}},{id:2784,attributes:{type:a,item_lang:{data:{id:3451,attributes:{title:"Renfield",slug:"renfield"}}}}},{id:2788,attributes:{type:a,item_lang:{data:{id:3455,attributes:{title:"The Killer",slug:"the-killer"}}}}},{id:2790,attributes:{type:a,item_lang:{data:{id:3457,attributes:{title:"The Color Purple",slug:"the-color-purple"}}}}},{id:2798,attributes:{type:e,item_lang:{data:{id:3465,attributes:{title:"Silo",slug:"silo"}}}}},{id:2802,attributes:{type:e,item_lang:{data:{id:3469,attributes:{title:"The Night Agent",slug:"the-night-agent"}}}}}],meta:{pagination:{page:h,pageSize:25,pageCount:h,total:10}}},dK9VPJpT3E:{data:{id:39,attributes:{imdbId:"tt4337690",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMjE5ODE3Mjc1MF5BMl5BanBnXkFtZTgwNzAwMzAyNjE@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"4.9\u002F10"},{Source:"Rotten Tomatoes",Value:"26%"},{Source:"Metacritic",Value:"28\u002F100"}],item_lang:{data:{id:702,attributes:{title:b,plot:"Based on a true story. A man was in a car crash and was in the car, without a pulse for an hour and a half, while EMT's and police waited for the coroner to pronounce him dead before he can be moved. A man comes along, who feels led to pray for the victim, gets in the car and starts to pray while singing praise songs. The 'dead' man starts singing along and EMT's confirm he now has a pulse. The victim fights his recovery, as he is angry that he was in heaven, only to have God bring him back in incredible pain. Was there a purpose to his return to earth?",slug:"90-minutes-in-heaven"}}},books:{data:[{id:1888,attributes:{title:b,description:"In the ten years since 90 Minutes in Heaven was published, millions of people worldwide have read the incredible true story of Don Piper's experience with death and life--and in reading they have found their own lives changed. After a semi-truck collided with Don Piper's car, he was pronounced dead at the scene. For the next ninety minutes, he experienced the glories of heaven. Back on earth, a passing minister felt led to stop and pray for the accident victim even though he was told Piper was dead. Miraculously, Piper came back to life, and the pleasure of heaven was replaced by a long and painful recovery. With a personal update from Don on the impact the book has had on him, his family, and the millions who have heard his story, even those who have read the original book will want to be part of the continuing story of 90 Minutes in Heaven with this new edition. Also includes a note from the publisher, stories from readers, favorite Scriptures and quotations on heaven from Don Piper, and a photo insert.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=dTmPvgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c,d],firstBook:true,published:"2014-07-01",publisher:f,subtitle:i}},{id:1889,attributes:{title:b,description:"Recounts the experience of Baptist minister Don Piper, who was pronounced dead after a car accident and experienced the glories of heaven for ninety minutes, but who miraculously came back to life only to endure a painful recovery.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=PuQzJvLnieEC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c,d],firstBook:g,published:"2009-11-01",publisher:f,subtitle:"My True Story"}},{id:1890,attributes:{title:b,description:"Now available in hardcover, 90 Minutes in Heaven is the runaway bestseller about one man's experience with death and life. As Baptist minister Don Piper drove home from a conference, his car collided with a semi-truck that had crossed into his lane. Piper was pronounced dead at the scene. For the next 90 minutes, he experienced the glories of heaven, where he was greeted by those who had influenced him spiritually, and he experienced true peace. Back on earth, a passing minister who had also been at the conference felt led to pray for the accident victim even though he was told Piper was dead. Miraculously, Piper came back to life, and the pleasure of heaven was replaced by a long and painful recovery. For years Don Piper kept his heavenly experience to himself. Finally, friends and family convinced him to share his remarkable story. An inspiring and encouraging account, 90 Minutes in Heaven continues to touch and comfort millions of people around the world as it offers a glimpse of inexpressible heavenly bliss.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=kTt2GgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c,d],firstBook:g,published:"2007-09-01",publisher:f,subtitle:"A True Story of Death and Life"}},{id:1891,attributes:{title:b,description:"As he is driving home from a minister's conference, Baptist minister Don Piper collides with a semi-truck that crosses into his lane. He is pronounced dead at the scene. For the next 90 minutes, Piper experiences heaven where he is greeted by those who had influenced him spiritually. He hears beautiful music and feels true peace. Back on earth, a passing minister who had also been at the conference is led to pray for Don even though he knows the man is dead. Piper miraculously comes back to life and the bliss of heaven is replaced by a long and painful recovery. For years Piper kept his heavenly experience to himself. Finally, however, friends and family convinced him to share his remarkable story.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=OyM3-IXdmJwC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c,d],firstBook:g,published:"2006-09-01",publisher:f,subtitle:i}},{id:1892,attributes:{title:"Daily Devotions Inspired by 90 Minutes in Heaven",description:"From the authors of the inspiring true story 90 Minutes in Heaven In 1989, Don Piper died in a car accident. Ninety minutes later, as a minister prayed over him, he returned to life-and remembered... For millions of readers around the world, Don Piper's account of his experience, 90 Minutes in Heaven, offers an inspirational, exciting, and fulfilling message of hope-and has become an international phenomenon. Now, he continues his message of hope and faith with a book of devotionals for all of those who want to experience the joy and contentment of his message every day. With ninety devotionals within, this unique collection directly addresses the everyday hardships we all endure, offering solace and guidance for all those who wish to lead happier, more virtuous lives.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=VN8rR0IKQFYC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c,d],firstBook:g,published:"2006-11-07",publisher:"Penguin",subtitle:"90 Readings for Hope and Healing"}}]}}},meta:{}}},prerenderedAt:1694069420999}}("movie","90 Minutes in Heaven","Don Piper","Cecil Murphey","series","Revell",null,1,"A True Story of Death & Life"))